import './UserForm.css';

const UserForm = () => {

    return (
        <div className="UserForm__input">
            <div className="UserForm__input">
            <h3>Username</h3>
            <h3>Age (Years)</h3>
            </div>
        </div>
    )

}

export default UserForm
